import React from 'react';

const Notes = ({ notes }) => {
  return (
    <div className="border border-gray-300 rounded p-4">
      {notes.map((note, index) => (
        <div key={index} className="mb-4">
          <h3 className="font-bold">{note.section}</h3>
          <p>{note.description}</p>
        </div>
      ))}
    </div>
  );
};

export default Notes;
